function PopupExportController(){jQuery('.export-progress .bar').bind('changePercent',function(event,data){if(data&&'undefined'!=typeof(data.timeLabel))jQuery('.export-progress .time').html(data.timeLabel)}).bind('error',function(){this.errorState=true;core.trigger('export.failed')}).bind('complete',function(){if(!this.errorState)core.trigger('export.completed')})}